import * as React from 'react';
import './how_works.css';
import logo_mvisia from '../img/logos-startups/logo-mvisia.svg';
import logo_flowsense from '../img/logos-startups/FlowsenseLogo.svg';
import logo_area25 from '../img/logos-startups/logo-area25.png';
import logo_hangar from '../img/logos-startups/logo-hangar.svg';
import logo_retina from '../img/logos-startups/Retina_vision_preto_low.png';

export class HowWorks extends React.Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div className="container" id="how-works-lab">
                <div className="col-md-5">
                    <h3>{this.props.titulo1}</h3>
                </div>
                <div className="container row textos-lab">
                    <div className="col-md-5 col-12 offset-0 offset-md-0 texto-esquerdo">
                        <p>No StartupLAB, a equipe receber√° todo o apoio, mentoria, material te√≥rico e conex√£o com empreendedores para tornar sua ideia em realidade.</p> {this.props.textolateral}
                        <div className="botao-lab">
                            <button type="button" className="button-primary" href="#">Saber mais</button>
                        </div>
                    </div>
                    <div className="col-md-5 col-8 offset-1 itens-lab">
                        <p>- 100% gratuito para todos os alunos e ex-alunos da USP</p> {this.props.item1}
                        <p>- Apoio e mentoria de fundadores e profissionais de startups</p> {this.props.item2}
                        <p>- Oferecimento gratuito de materiais montados pelo time NEU</p> {this.props.item3}
                        <p>- Encontros semanais com outras equipes de nossa pr√©-acelera√ß√£o</p> {this.props.item4}
                    </div>
                </div>
                <div className="cases-de-sucesso">
                    <div className="col-sm-3 texto-cases">
                        <h4>Alguns cases de sucesso do NEU:</h4> {this.props.titulo2}
                    </div>
                    <div className="col-sm-10 logo-startups-lab">
                        <a href="http://mvisia.com.br/" target="#">
                            <img className="logo-mvisia responsive" src={logo_mvisia} alt="MVISIA"/> {this.props.startup1}
                        </a>
                        <a href="https://www.retinavision.com.br/" target="#">
                            <img className="logo-retina responsive" src={logo_retina} alt="Retina Vision"/> {this.props.startup2}
                        </a>
                        <a href="http://flowsense.com.br/" target="#">
                            <img className="logo-flowsense responsive" src={logo_flowsense} alt="Flowsense"/> {this.props.startup3}
                        </a>
                    </div>
                </div>
            </div>
        )
    }
}
